import React from 'react'

function Signup() {
  return (
    <div className='mt-[8rem] flex flex-col justify-center items-center gap-[1rem]'>
      <h1>Register</h1>
      <div className='flex flex-col items-center gap-[1rem]'>
      <input type='text' placeholder='Enter Name' className='py-[0.6rem] px-[1rem] w-[100%] border-solid border-2 border-black rounded'/>
      <input type='text' placeholder='Enter Email' className='py-[0.6rem] px-[1rem] border-solid border-2 border-black rounded'/>
      <input type='password' placeholder='Enter Password' className='py-[0.6rem] px-[1rem] border-solid border-2 border-black rounded'/>
      </div>
    </div>
  )
}

export default Signup;
